	this.interactives_button = new lib.interactives_button();
	this.interactives_button.name = "interactives_button";
	this.interactives_button.setTransform(1188.35,816.2,1.0034,1.0069,0,0,0,-1.5,0.2);
	new cjs.ButtonHelper(this.interactives_button, 0, 1, 2);

	this.resources_main_menu_button = new lib.resources_main_menu_button();
	this.resources_main_menu_button.name = "resources_main_menu_button";
	this.resources_main_menu_button.setTransform(1198.6,990.25,1,1,0,0,0,2.5,0);
	new cjs.ButtonHelper(this.resources_main_menu_button, 0, 1, 2);

	this.shape_2 = new cjs.Shape();
	this.shape_2.graphics.f("#F9FAF5").s().p("");
	this.shape_2.setTransform(430.35,220.25);

	this.shape_3 = new cjs.Shape();
	this.shape_3.graphics.f().s("#0F0426").ss(10).p("");
	this.shape_3.setTransform(430.35,220.25);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.shape_3},{t:this.shape_2},{t:this.resources_main_menu_button},{t:this.interactives_button},{t:this.start_button},{t:this.shape_1},{t:this.shape}]}).wait(1));

	this._renderFirstFrame();

